import{_ as a,c as t,o as e,d as p}from"./app.c4f45da1.js";const J=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"title: \u674E\u5175-\u56FE\u89E3GoogleV8","slug":"title-\u674E\u5175-\u56FE\u89E3googlev8","link":"#title-\u674E\u5175-\u56FE\u89E3googlev8","children":[]},{"level":2,"title":"\u4EC0\u4E48\u662FV8\uFF1F","slug":"\u4EC0\u4E48\u662Fv8\uFF1F","link":"#\u4EC0\u4E48\u662Fv8\uFF1F","children":[]},{"level":2,"title":"\u5982\u4F55\u5B66\u4E60V8\uFF1F","slug":"\u5982\u4F55\u5B66\u4E60v8\uFF1F","link":"#\u5982\u4F55\u5B66\u4E60v8\uFF1F","children":[]}],"relativePath":"JavaScript/\u674E\u5175-\u56FE\u89E3GoogleV8/index.md"}'),r={name:"JavaScript/\u674E\u5175-\u56FE\u89E3GoogleV8/index.md"},i=p('<hr><h2 id="title-\u674E\u5175-\u56FE\u89E3googlev8" tabindex="-1">title: \u674E\u5175-\u56FE\u89E3GoogleV8 <a class="header-anchor" href="#title-\u674E\u5175-\u56FE\u89E3googlev8" aria-hidden="true">#</a></h2><p>\u5F00\u7BC7\u8BCD | \u5982\u4F55\u5B66\u4E60\u8C37\u6B4C\u9AD8\u6027\u80FD JavaScript \u5F15\u64CEV8\uFF1F</p><p>\u4F60\u597D\uFF0C\u6211\u662F\u674E\u5175\uFF0C\u300A<a href="https://time.geekbang.org/column/intro/216?utm_term=zeusQYFJN&amp;utm_source=app&amp;utm_medium=geektime&amp;utm_campaign=216-end&amp;utm_content=v8zhuanlankaipianci0316" target="_blank" rel="noreferrer">\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5</a>\u300B\u4E13\u680F\u7684\u4F5C\u8005\u3002\u5728\u6D4F\u89C8\u5668\u4E13\u680F\u4E2D\uFF0C\u6211\u4EEC\u5BF9\u6D4F\u89C8\u5668\u7684\u5DE5\u4F5C\u539F\u7406\u8FDB\u884C\u4E86\u8BE6\u7EC6\u7684\u4ECB\u7ECD\uFF0C\u5176\u4E2D\u4E5F\u63D0\u5230\u4E86V8\u662F\u5982\u4F55\u6267\u884CJavaScript\u4EE3\u7801\u7684\u3002\u5F88\u591A\u670B\u53CB\u5BF9\u8FD9\u90E8\u5206\u7684\u5B66\u4E60\u610F\u72B9\u672A\u5C3D\uFF0C\u56E0\u6B64\u6211\u53C8\u56DE\u5230\u4E86\u6781\u5BA2\u65F6\u95F4\uFF0C\u4E0E\u4F60\u6DF1\u5165\u804A\u804AV8\u3002</p><h2 id="\u4EC0\u4E48\u662Fv8\uFF1F" tabindex="-1">\u4EC0\u4E48\u662FV8\uFF1F <a class="header-anchor" href="#\u4EC0\u4E48\u662Fv8\uFF1F" aria-hidden="true">#</a></h2><p>V8\u662FJavaScript\u865A\u62DF\u673A\u7684\u4E00\u79CD\u3002\u6211\u4EEC\u53EF\u4EE5\u7B80\u5355\u5730\u628AJavaScript\u865A\u62DF\u673A\u7406\u89E3\u6210\u662F\u4E00\u4E2A\u7FFB\u8BD1\u7A0B\u5E8F\uFF0C\u5C06\u4EBA\u7C7B\u80FD\u591F\u7406\u89E3\u7684<strong>\u7F16\u7A0B\u8BED\u8A00JavaScript</strong>\uFF0C\u7FFB\u8BD1\u6210\u673A\u5668\u80FD\u591F\u7406\u89E3\u7684<strong>\u673A\u5668\u8BED\u8A00</strong>\u3002\u5982\u4E0B\u56FE\u6240\u793A\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/8a/a1/8a40fd003baa9be179fe2e55a1be5fa1.jpg" alt="" title="JavaScript\u5F15\u64CE"></p><p>\u4E0A\u56FE\u4E2D\uFF0C\u4E2D\u95F4\u7684\u201C\u9ED1\u76D2\u201D\u5C31\u662FJavaScript\u5F15\u64CEV8\u3002\u76EE\u524D\u5E02\u9762\u4E0A\u6709\u5F88\u591A\u79CDJavaScript\u5F15\u64CE\uFF0C\u8BF8\u5982SpiderMonkey\u3001V8\u3001JavaScriptCore\u7B49\u3002\u800C\u7531\u8C37\u6B4C\u5F00\u53D1\u7684\u5F00\u6E90\u9879\u76EEV8\u662F\u5F53\u4E0B\u4F7F\u7528\u6700\u5E7F\u6CDB\u7684JavaScript\u865A\u62DF\u673A\uFF0C\u5168\u7403\u6709\u8D85\u8FC725\u4EBF\u53F0\u5B89\u5353\u8BBE\u5907\uFF0C\u800C\u8FD9\u4E9B\u8BBE\u5907\u4E2D\u90FD\u4F7F\u7528\u4E86Chrome\u6D4F\u89C8\u5668\uFF0C\u6240\u4EE5\u6211\u4EEC\u5199\u7684JavaScript\u5E94\u7528\uFF0C\u5927\u90FD\u8DD1\u5728V8\u4E0A\u3002</p><p>V8\u4E4B\u6240\u4EE5\u62E5\u6709\u5982\u6B64\u5E9E\u5927\u7684\u751F\u6001\u5708\uFF0C\u4E5F\u548C\u5B83\u8BB8\u591A\u9769\u547D\u6027\u7684\u8BBE\u8BA1\u662F\u5206\u4E0D\u5F00\u7684\u3002</p><p>\u5728V8\u51FA\u73B0\u4E4B\u524D\uFF0C\u6240\u6709\u7684JavaScript\u865A\u62DF\u673A\u6240\u91C7\u7528\u7684\u90FD\u662F\u89E3\u91CA\u6267\u884C\u7684\u65B9\u5F0F\uFF0C\u8FD9\u662FJavaScript\u6267\u884C\u901F\u5EA6\u8FC7\u6162\u7684\u4E00\u4E2A\u4E3B\u8981\u539F\u56E0\u3002\u800CV8\u7387\u5148\u5F15\u5165\u4E86\u5373\u65F6\u7F16\u8BD1\uFF08JIT\uFF09\u7684\u53CC\u8F6E\u9A71\u52A8\u7684\u8BBE\u8BA1\uFF0C\u8FD9\u662F\u4E00\u79CD\u6743\u8861\u7B56\u7565\uFF0C\u6DF7\u5408\u7F16\u8BD1\u6267\u884C\u548C\u89E3\u91CA\u6267\u884C\u8FD9\u4E24\u79CD\u624B\u6BB5\uFF0C\u7ED9JavaScript\u7684\u6267\u884C\u901F\u5EA6\u5E26\u6765\u4E86\u6781\u5927\u7684\u63D0\u5347\u3002</p><p>V8\u51FA\u73B0\u4E4B\u540E\uFF0C\u5404\u5927\u5382\u5546\u4E5F\u90FD\u5728\u81EA\u5DF1\u7684JavaScript\u865A\u62DF\u673A\u4E2D\u5F15\u5165\u4E86JIT\u673A\u5236\uFF0C\u6240\u4EE5\u4F60\u4F1A\u770B\u5230\u76EE\u524D\u5E02\u9762\u4E0AJavaScript\u865A\u62DF\u673A\u90FD\u6709\u7740\u7C7B\u4F3C\u7684\u67B6\u6784\u3002\u53E6\u5916\uFF0CV8\u4E5F\u662F\u65E9\u4E8E\u5176\u4ED6\u865A\u62DF\u673A\u5F15\u5165\u4E86\u60F0\u6027\u7F16\u8BD1\u3001\u5185\u8054\u7F13\u5B58\u3001\u9690\u85CF\u7C7B\u7B49\u673A\u5236\uFF0C\u8FDB\u4E00\u6B65\u4F18\u5316\u4E86JavaScript\u4EE3\u7801\u7684\u7F16\u8BD1\u6267\u884C\u6548\u7387\u3002</p><p>\u53EF\u4EE5\u8BF4\uFF0CV8\u7684\u51FA\u73B0\uFF0C\u5C06JavaScript\u865A\u62DF\u673A\u6280\u672F\u63A8\u5411\u4E86\u4E00\u4E2A\u5168\u65B0\u7684\u9AD8\u5EA6\u3002</p><p>\u5373\u4FBFV8\u5177\u6709\u8BF8\u591A\u4F18\u70B9\uFF0C\u4F46\u6211\u76F8\u4FE1\u5BF9\u4E8E\u5927\u90E8\u5206\u540C\u5B66\u6765\u8BF4\uFF0CV8\u865A\u62DF\u673A\u8FD8\u53EA\u662F\u4E00\u4E2A\u9ED1\u76D2\uFF0C\u6211\u4EEC\u5C06\u4E00\u6BB5\u4EE3\u7801\u4E22\u7ED9\u8FD9\u4E2A\u9ED1\u76D2\uFF0C\u5B83\u4FBF\u4F1A\u8FD4\u56DE\u7ED3\u679C\uFF0C\u5E76\u6CA1\u6709\u6DF1\u5165\u4E86\u89E3\u8FC7\u5B83\u7684\u5DE5\u4F5C\u539F\u7406\u3002</p><p>\u5982\u679C\u53EA\u662F\u5355\u7EAF\u4F7F\u7528JavaScript\u548C\u8C03\u7528 Web API\uFF0C\u5E76\u4E0D\u4E86\u89E3\u865A\u62DF\u673A\u5185\u90E8\u662F\u600E\u6837\u5DE5\u4F5C\u7684\uFF0C\u5728\u9879\u76EE\u4E2D\u9047\u5230\u7684\u5F88\u591A\u95EE\u9898\u5F88\u53EF\u80FD\u627E\u4E0D\u5230\u89E3\u51B3\u7684\u9014\u5F84\u3002\u6BD4\u5982\uFF0C\u6709\u65F6\u9879\u76EE\u7684\u5360\u7528\u5185\u5B58\u8FC7\u9AD8\uFF0C\u6216\u8005\u9875\u9762\u54CD\u5E94\u901F\u5EA6\u8FC7\u6162\uFF0C\u53C8\u6216\u8005\u4F7F\u7528Node.js\u7684\u65F6\u5019\u5BFC\u81F4\u4EFB\u52A1\u88AB\u963B\u585E\u7B49\u95EE\u9898\uFF0C\u90FD\u4E0EV8\u7684\u57FA\u672C\u8FD0\u884C\u673A\u5236\u6709\u5173\u3002\u5982\u679C\u4F60\u719F\u6089V8\u7684\u5DE5\u4F5C\u673A\u5236\uFF0C\u5C31\u4F1A\u6709\u7CFB\u7EDF\u6027\u7684\u601D\u8DEF\u6765\u89E3\u51B3\u8FD9\u4E9B\u95EE\u9898\u3002</p><p>\u53E6\u5916\uFF0CV8\u7684\u4E3B\u8981\u529F\u80FD\uFF0C\u5C31\u662F\u7ED3\u5408JavaScript\u8BED\u8A00\u7684\u7279\u6027\u548C\u672C\u8D28\u6765\u7F16\u8BD1\u6267\u884C\u5B83\u3002\u901A\u8FC7\u6DF1\u5165\u5730\u5B66\u4E60V8\uFF0C\u4F60\u5BF9JavaScript\u8BED\u8A00\u672C\u8D28\u548C\u8BBE\u8BA1\u601D\u60F3\u4F1A\u6709\u5F88\u76F4\u89C2\u7684\u611F\u53D7\u3002\u8FD9\u4E9B\u8BBE\u8BA1\u601D\u60F3\u50CF\u662F\u66F4\u52A0\u9AD8\u7EA7\u7684\u5DE5\u5177\uFF0C\u4F60\u638C\u63E1\u4E86\u5B83\uFF0C\u5C31\u53EF\u4EE5\u63D0\u5347\u4F60\u7684\u8BED\u8A00\u4F7F\u7528\u548C\u67B6\u6784\u8BBE\u8BA1\u6C34\u5E73\u3002</p><h2 id="\u5982\u4F55\u5B66\u4E60v8\uFF1F" tabindex="-1">\u5982\u4F55\u5B66\u4E60V8\uFF1F <a class="header-anchor" href="#\u5982\u4F55\u5B66\u4E60v8\uFF1F" aria-hidden="true">#</a></h2><p>\u90A3\u4E48\uFF0C\u6211\u4EEC\u5E94\u8BE5\u5982\u4F55\u6765\u5B66\u4E60V8\u5462\uFF1F</p><p>\u521A\u521A\u6211\u4EEC\u4E5F\u8BF4\u8FC7\uFF0CV8\u7684\u4E3B\u8981\u804C\u8D23\u662F\u7528\u6765\u6267\u884CJavaScript\u4EE3\u7801\u7684\uFF0C\u90A3\u6211\u4EEC\u9996\u5148\u9700\u8981\u5148\u4E86\u89E3JavaScript\u8FD9\u95E8\u8BED\u8A00\u7684\u57FA\u672C\u7279\u6027\u548C\u8BBE\u8BA1\u601D\u60F3\u3002</p><p>JavaScript\u501F\u9274\u4E86\u5F88\u591A\u8BED\u8A00\u7684\u7279\u6027\uFF0C\u6BD4\u5982C\u8BED\u8A00\u7684\u57FA\u672C\u8BED\u6CD5\u3001Java\u7684\u7C7B\u578B\u7CFB\u7EDF\u548C\u5185\u5B58\u7BA1\u7406\u3001Scheme\u7684\u51FD\u6570\u4F5C\u4E3A\u4E00\u7B49\u516C\u6C11\uFF0C\u8FD8\u6709Self\u57FA\u4E8E\u539F\u578B\uFF08prototype\uFF09\u7684\u7EE7\u627F\u673A\u5236\u3002\u6BEB\u65E0\u7591\u95EE\uFF0CJavaScript\u662F\u4E00\u95E8\u975E\u5E38\u4F18\u79C0\u7684\u8BED\u8A00\uFF0C\u7279\u522B\u662F\u201C\u539F\u578B\u7EE7\u627F\u673A\u5236\u201D\u548C\u201C\u51FD\u6570\u662F\u4E00\u7B49\u516C\u6C11\u201D\u8FD9\u4E24\u4E2A\u8BBE\u8BA1\u3002</p><p><img src="https://static001.geekbang.org/resource/image/f8/7a/f8fb9e3570b88152f9ab7b6b8d385c7a.jpg" alt="" title="JavaScript\u7684\u8BBE\u8BA1\u601D\u60F3"></p><p>\u4E0D\u8FC7JavaScript\u4E5F\u662F\u4E00\u95E8\u5904\u5904\u662F\u5751\u7684\u8BED\u8A00\uFF0C\u7531\u4E8E\u5386\u53F2\u539F\u56E0\uFF0C\u5F88\u591A\u9519\u8BEF\u7684\u6216\u8005\u4E0D\u5408\u7406\u7684\u8BBE\u8BA1\u90FD\u88AB\u5EF6\u7EED\u81F3\u4ECA\uFF0C\u6BD4\u5982\u4F7F\u7528new\u52A0\u6784\u9020\u51FD\u6570\u6765\u521B\u5EFA\u5BF9\u8C61\uFF0C\u8FD9\u79CD\u65B9\u5F0F\u7684\u80CC\u540E\u9690\u85CF\u4E86\u592A\u591A\u7684\u7EC6\u8282\uFF0C\u975E\u5E38\u5BB9\u6613\u589E\u52A0\u4EE3\u7801\u51FA\u9519\u6982\u7387\uFF0C\u800C\u4E14\u4E5F\u5927\u5927\u589E\u52A0\u4E86\u65B0\u624B\u7684\u5B66\u4E60\u6210\u672C\uFF1B\u518D\u6BD4\u5982\u521D\u671F\u7684JavaScript\u6CA1\u6709\u5757\u7EA7\u4F5C\u7528\u57DF\u673A\u5236\uFF0C\u4F7F\u5F97JavaScript\u9700\u8981\u91C7\u53D6\u53D8\u91CF\u63D0\u5347\u7684\u7B56\u7565\uFF0C\u800C\u53D8\u91CF\u63D0\u5347\u53C8\u662F\u975E\u5E38\u53CD\u4EBA\u6027\u7684\u8BBE\u8BA1\u3002</p><p>V8\u662FJavaScript\u7684\u5B9E\u73B0\uFF0C\u5728\u5B66\u4E60V8\u5DE5\u4F5C\u539F\u7406\u65F6\uFF0C\u6211\u4EEC\u5C31\u8981\u683C\u5916\u5173\u6CE8JavaScript\u8FD9\u4E9B\u72EC\u7279\u7684\u8BBE\u8BA1\u601D\u60F3\u548C\u7279\u6027\u80CC\u540E\u7684\u5B9E\u73B0\u3002\u6BD4\u5982\uFF0C\u4E3A\u4E86\u5B9E\u73B0\u51FD\u6570\u662F\u4E00\u7B49\u516C\u6C11\u7684\u7279\u6027\uFF0CJavaScript\u91C7\u53D6\u4E86\u57FA\u4E8E\u5BF9\u8C61\u7684\u7B56\u7565\uFF1B\u518D\u6BD4\u5982\u4E3A\u4E86\u5B9E\u73B0\u539F\u578B\u7EE7\u627F\uFF0CV8\u4E3A\u6BCF\u4E2A\u5BF9\u8C61\u5F15\u5165\u4E86__proto__\u5C5E\u6027\u3002</p><p><strong>\u6DF1\u5165\u5206\u6790\u8FC7JavaScript\u8BED\u8A00\u4E4B\u540E\uFF0C\u6211\u4EEC\u5C31\u53EF\u4EE5\u5B66\u4E60V8\u6267\u884CJavaScript\u4EE3\u7801\u7684\u5B8C\u6574\u6D41\u7A0B\u4E86</strong>\u3002\u6211\u4EEC\u628A\u8FD9\u5957\u6D41\u7A0B\u79F0\u4E4B\u4E3AV8\u7684\u7F16\u8BD1\u6D41\u6C34\u7EBF\uFF0C\u5176\u5B8C\u6574\u6D41\u7A0B\u5982\u4E0B\u56FE\u6240\u793A\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/8a/54/8a34ae8c1a7a0f87e19b1384a025e354.jpg" alt="" title="V8\u7F16\u8BD1\u6D41\u6C34\u7EBF"></p><p>\u7F16\u8BD1\u6D41\u6C34\u7EBF\u672C\u8EAB\u5E76\u4E0D\u590D\u6742\uFF0C\u4F46\u662F\u5176\u4E2D\u6D89\u53CA\u5230\u4E86\u5F88\u591A\u6280\u672F\uFF0C\u8BF8\u5982JIT\u3001\u5EF6\u8FDF\u89E3\u6790\u3001\u9690\u85CF\u7C7B\u3001\u5185\u8054\u7F13\u5B58\u7B49\u7B49\u3002\u8FD9\u4E9B\u6280\u672F\u51B3\u5B9A\u7740\u4E00\u6BB5JavaScript\u4EE3\u7801\u80FD\u5426\u6B63\u5E38\u6267\u884C\uFF0C\u4EE5\u53CA\u4EE3\u7801\u7684\u6267\u884C\u6548\u7387\u3002</p><p>\u6BD4\u5982V8\u4E2D\u4F7F\u7528\u7684\u9690\u85CF\u7C7B\uFF08Hide Class\uFF09\uFF0C\u8FD9\u662F\u5C06JavaScript\u4E2D\u52A8\u6001\u7C7B\u578B\u8F6C\u6362\u4E3A\u9759\u6001\u7C7B\u578B\u7684\u4E00\u79CD\u6280\u672F\uFF0C\u53EF\u4EE5\u6D88\u9664\u52A8\u6001\u7C7B\u578B\u7684\u8BED\u8A00\u6267\u884C\u901F\u5EA6\u8FC7\u6162\u7684\u95EE\u9898\uFF0C\u5982\u679C\u4F60\u719F\u6089V8\u7684\u5DE5\u4F5C\u673A\u5236\uFF0C\u5728\u4F60\u7F16\u5199JavaScript\u65F6\uFF0C\u5C31\u80FD\u5145\u5206\u5229\u7528\u597D\u9690\u85CF\u7C7B\u8FD9\u79CD\u5F3A\u5927\u7684\u4F18\u5316\u7279\u6027\uFF0C\u5199\u51FA\u66F4\u52A0\u9AD8\u6548\u7684\u4EE3\u7801\u3002</p><p>\u518D\u6BD4\u5982\uFF0CV8\u5B9E\u73B0\u4E86JavaScript\u4EE3\u7801\u7684\u60F0\u6027\u89E3\u6790\uFF0C\u76EE\u7684\u662F\u4E3A\u4E86\u52A0\u901F\u4EE3\u7801\u7684\u542F\u52A8\u901F\u5EA6\uFF0C\u901A\u8FC7\u5BF9\u60F0\u6027\u89E3\u6790\u673A\u5236\u7684\u5B66\u4E60\uFF0C\u4F60\u53EF\u4EE5\u4F18\u5316\u4F60\u7684\u4EE3\u7801\u66F4\u52A0\u9002\u5E94\u8FD9\u4E2A\u673A\u5236\uFF0C\u4ECE\u800C\u63D0\u9AD8\u7A0B\u5E8F\u6027\u80FD\u3002</p><p>\u8981\u60F3\u5145\u5206\u4E86\u89E3V8\u662F\u600E\u4E48\u5DE5\u4F5C\u7684\uFF0C\u9664\u4E86\u8981\u5206\u6790\u7F16\u8BD1\u6D41\u6C34\u7EBF\uFF0C\u6211\u4EEC\u8FD8\u9700\u8981\u4E86\u89E3\u53E6\u5916\u4E24\u4E2A\u975E\u5E38\u91CD\u8981\u7684\u7279\u6027\uFF0C\u90A3\u5C31\u662F<strong>\u4E8B\u4EF6\u5FAA\u73AF\u7CFB\u7EDF</strong>\u548C<strong>\u5783\u573E\u56DE\u6536\u673A\u5236\u3002</strong></p><p>\u4E8B\u4EF6\u5FAA\u73AF\u7CFB\u7EDF\u548CJavaScript\u4E2D\u7684\u96BE\u70B9\u2014\u2014\u5F02\u6B65\u7F16\u7A0B\u7279\u6027\u7D27\u5BC6\u76F8\u5173\u3002\u6211\u4EEC\u77E5\u9053\uFF0CJavaScript\u662F\u5355\u7EBF\u7A0B\u7684\uFF0CJavaScript\u4EE3\u7801\u90FD\u662F\u5728\u4E00\u4E2A\u7EBF\u7A0B\u4E0A\u6267\u884C\uFF0C\u5982\u679C\u540C\u4E00\u65F6\u95F4\u53D1\u9001\u4E86\u591A\u4E2AJavaScript\u6267\u884C\u7684\u8BF7\u6C42\uFF0C\u5C31\u9700\u8981\u6392\u961F\uFF0C\u4E5F\u5C31\u662F\u8FDB\u884C\u5F02\u6B65\u7F16\u7A0B\u3002</p><p>V8\u7684\u4E8B\u4EF6\u5FAA\u73AF\u7CFB\u7EDF\u4F1A\u8C03\u5EA6\u8FD9\u4E9B\u6392\u961F\u4EFB\u52A1\uFF0C\u4FDD\u8BC1JavaScript\u4EE3\u7801\u88ABV8\u6709\u5E8F\u5730\u6267\u884C\u3002\u56E0\u6B64\u4E5F\u53EF\u4EE5\u8BF4\uFF0C\u4E8B\u4EF6\u5FAA\u73AF\u7CFB\u7EDF\u5C31\u662FV8\u7684\u5FC3\u810F\uFF0C\u5B83\u9A71\u52A8\u4E86V8\u7684\u6301\u7EED\u5DE5\u4F5C\u3002</p><p>\u53E6\u5916\uFF0CJavaScript\u662F\u4E00\u79CD\u81EA\u52A8\u5783\u573E\u56DE\u6536\u7684\u8BED\u8A00\uFF0CV8\u5728\u6267\u884C\u5783\u573E\u56DE\u6536\u65F6\uFF0C\u4F1A\u5360\u7528\u4E3B\u7EBF\u7A0B\u7684\u8D44\u6E90\uFF0C\u5982\u679C\u6211\u4EEC\u7F16\u5199\u7684\u7A0B\u5E8F\u9891\u7E41\u89E6\u53D1\u5783\u573E\u56DE\u6536\uFF0C\u90A3\u4E48\u65E0\u7591\u4F1A\u963B\u585E\u4E3B\u7EBF\u7A0B\uFF0C\u8FD9\u4E5F\u662F\u6211\u4EEC\u7ECF\u5E38\u4F1A\u9047\u5230\u7684\u4E00\u4E2A\u95EE\u9898\u3002\u4F60\u9700\u8981\u77E5\u9053V8\u662F\u5982\u4F55\u5206\u914D\u5185\u5B58\u6570\u636E\u7684\uFF0C\u4EE5\u53CA\u8FD9\u4E9B\u6570\u636E\u662F\u5982\u4F55\u88AB\u56DE\u6536\u7684\uFF0C\u6253\u901A\u6574\u4E2A\u94FE\u8DEF\uFF0C\u5EFA\u7ACB\u5B8C\u6574\u7684\u7CFB\u7EDF\uFF0C\u5F53\u4E0B\u6B21\u9047\u5230\u5185\u5B58\u95EE\u9898\u65F6\uFF0C\u5C31\u77E5\u9053\u5982\u4F55\u53BB\u6392\u67E5\u4E86\u3002</p><p><img src="https://static001.geekbang.org/resource/image/90/43/90228d5cc0afbaaa4cca3fbdb1349243.jpg" alt="" title="V8\u77E5\u8BC6\u56FE\u8C31\uFF0C\u53EF\u4EE5\u70B9\u51FB\u653E\u5927\u67E5\u770B"></p><p>\u4EE5\u4E0A\uFF0C\u5C31\u662F\u7CFB\u7EDF\u5B66\u4E60V8\u7684\u8DEF\u5F84\u3002\u5728\u6211\u4EEC\u8FD9\u4E00\u5B63\u7684\u8BFE\u7A0B\u4E2D\uFF0C\u4E5F\u4F1A\u6309\u7167\u8FD9\u6837\u7684\u601D\u8DEF\u6765\u8BBE\u8BA1\u8BFE\u7A0B\uFF0C\u6765\u5E2E\u52A9\u4F60\u5B66\u4E60\u5230V8\u7684\u5B8C\u6574\u7684\u77E5\u8BC6\u4F53\u7CFB\u3002</p><ul><li>\u9996\u5148\uFF0C\u6211\u4EEC\u4F1A\u4ECEJavaScript\u7684\u8BBE\u8BA1\u601D\u60F3\u8BB2\u8D77\uFF0C\u8BA8\u8BBA\u5B83\u80CC\u540E\u7684\u4E00\u4E9B\u4E3B\u8981\u7279\u6027\uFF0C\u4EE5\u53CAV8\u662F\u600E\u4E48\u5B9E\u73B0\u8FD9\u4E9B\u7279\u6027\u7684\u3002</li><li>\u7136\u540E\uFF0C\u6211\u4EEC\u518D\u6765\u5206\u6790V8\u7684\u7F16\u8BD1\u6D41\u6C34\u7EBF\uFF0C\u5728\u8BFE\u7A0B\u4E2D\u95F4\u6211\u4EEC\u8FD8\u4F1A\u7A7F\u63D2\u4ECB\u7ECD\u4E00\u4E9B\u5185\u5B58\u5206\u914D\u76F8\u5173\u7684\u5185\u5BB9\uFF0C\u56E0\u4E3A\u51FD\u6570\u8C03\u7528\u3001\u53D8\u91CF\u58F0\u660E\u3001\u53C2\u6570\u4F20\u9012\u6216\u8005\u51FD\u6570\u8FD4\u56DE\u6570\u503C\u90FD\u6D89\u53CA\u5230\u4E86\u5185\u5B58\u5206\u914D\u3002</li><li>\u6700\u540E\uFF0C\u6211\u4EEC\u4F1A\u4ECB\u7ECD\u4E8B\u4EF6\u5FAA\u73AF\u7CFB\u7EDF\u548C\u5783\u573E\u56DE\u6536\u7CFB\u7EDF\u7684\u5DE5\u4F5C\u673A\u5236\u3002</li></ul><p><img src="https://static001.geekbang.org/resource/image/26/e3/2684822c6cb6b453c6f4abb3d89822e3.jpg" alt="" title="\u4E13\u680F\u76EE\u5F55"></p><p>\u867D\u7136\u672C\u8BFE\u7A0B\u7684\u7BC7\u5E45\u4E0D\u591A\uFF0C\u4F46\u662F\u4E5F\u5177\u6709\u4E00\u5B9A\u7684\u6DF1\u5EA6\u548C\u5E7F\u5EA6\u3002\u4E0D\u8FC7\u4F60\u5E76\u4E0D\u9700\u8981\u62C5\u5FC3\u5185\u5BB9\u592A\u96BE\uFF0C\u6211\u4F1A\u5C3D\u91CF\u5C06\u6BCF\u8282\u5185\u5BB9\u505A\u5230\u6DF1\u5165\u6D45\u51FA\uFF0C\u6709\u4EC0\u4E48\u95EE\u9898\u4F60\u53EF\u4EE5\u5728\u7559\u8A00\u533A\u63D0\u95EE\uFF0C\u6211\u770B\u5230\u540E\u90FD\u4F1A\u7B2C\u4E00\u65F6\u95F4\u6765\u89E3\u7B54\u3002</p><p>\u53E6\u5916\uFF0C\u5728\u6BCF\u4E2A\u6A21\u5757\u7ED3\u675F\u540E\uFF0C\u6211\u4F1A\u505A\u4E00\u6B21\u70ED\u70B9\u95EE\u9898\u7684\u7B54\u7591\uFF0C\u5C3D\u91CF\u5E2E\u4F60\u626B\u6E05\u5B66\u4E60V8\u7684\u969C\u788D\u3002\u4F60\u9700\u8981\u505A\u7684\u662F\u6301\u4E4B\u4EE5\u6052\u5730\u5B66\u4E60\u3001\u53CD\u601D\u4E0E\u5B9E\u8DF5\u3002</p><p>\u52A0\u6CB9\uFF0C\u4ECE\u4ECA\u5929\u8D77\uFF0C\u5C31\u8BA9\u6211\u4EEC\u4E00\u8D77\u5F00\u59CBV8\u7684\u5B66\u4E60\u65C5\u7A0B\u5427\uFF01</p>',38),c=[i];function o(l,s,v,n,g,V){return e(),t("div",null,c)}const d=a(r,[["render",o]]);export{J as __pageData,d as default};
